import React from 'react';

class Items extends React.Component {
    constructor(props) {
        super(props);
        this.state = {list: []};
    }

    componentDidMount() {
        fetch('http://localhost:8080/instructors/tharms/courses', {
            method: 'GET',
            headers: {
                "Content-type": "application/json; charset=UTF-8"
            }
        }).then(response => {
            return response.json()
        }).then(json => {
            this.setState({
                list:json
            });
        });
    }


    render() {
        return (
            <div>
                <ul>
                    {this.state.list.map(d => <li key={d.id}>{d.username} - {d.description}</li>)}
                </ul>
                <p><b>New Resource created in the server as shown below</b></p>
            </div>
        )
    }
}

export default Items;
